	 ('ffd71afe-6ae0-4f49-b767-e324e65061b8','en_IN','UNDERTAKING_POINT1','1. I do not have more than 2 dogs.','ch','rainmaker-pm',24226,'2019-03-25 13:55:25.827',NULL,NULL),
	 ('ffd71afe-6ae0-4f49-b767-e324e65061b9','en_IN','UNDERTAKING_POINT2','2. I shall keep the dog protected by getting it vaccinated against rabies from a Govt. Veterinary Practitioner or Veterinary Practitioner duly registered with Indian Veterinary council (IVC) or State Veterinary council (SVC).','ch','rainmaker-pm',24226,'2019-03-25 13:55:25.827',NULL,NULL),
	 ('ffd71afe-6ae0-4f49-b767-e324e65069d2','en_IN','UNDERTAKING_POINT3','3. I will furnish the vaccination certificate on demand during inspection by Registration Authority or any officer/official of the Municipal Corporation duly authorized by the Registration Authority or within a period of 10 days from such Inspection, failing which registration of the dog may be cancelled.','ch','rainmaker-pm',24226,'2019-03-25 13:55:25.827',NULL,NULL),
	 ('ffd71afe-6ae0-4f49-b767-e324e65069d3','en_IN','UNDERTAKING_POINT4','4. I will keep the dog chained/leashed while taking it outside. All ferocious dogs shall be duly muzzled and a stick shall be carried by the Escort accompanying the dogs while taking it out.','ch','rainmaker-pm',24226,'2019-03-25 13:55:25.827',NULL,NULL),
	 ('ffd71afe-6ae0-4f49-b767-e324e65069d4','en_IN','UNDERTAKING_POINT5','5. I will ensure that the dog will wear a collar affixed with the metal token issued by the Registration Authority at all the times.','ch','rainmaker-pm',24226,'2019-03-25 13:55:25.827',NULL,NULL),
	 ('ffd71afe-6ae0-4f49-b767-e324e65069d5','en_IN','UNDERTAKING_POINT6','6. I will compensate the person if a dog bites or causes any other
